/* eslint-disable */
const { getDate } = require('./dateUtils');

function createReport(offers, suppliers) {
    const date = getDate();

  let relatorioHTML = `<!DOCTYPE html>
    <html lang="pt/br">
        <head>
        <meta charset="UTF-8">
        <title>Report Template</title>
        <style>
            html {
                font-family: Arial, Helvetica, sans-serif;
                margin: 0;
                font-size: 12px;
            }
            table {
                border-collapse: collapse;
                text-align: center;
                vertical-align: center;
                width: 100%;
            }
            td {
                font-size: 0.8rem;
                border-color: gray;
                border-style: solid;
                border-width: 1px;
                padding: 10px 5px;
            }

            .supplier-header td {
                padding-left: 10px;
                text-align: left;
                border-bottom: 0;
                border-color: gray;
                background-color: lightgray;
            }

            .items td {
                border-top: 0;
            }

            .total {
                background-color: lightgray;
                border-color: gray;
            }

            th {
                font-size: 0.8rem;
                border-color: gray;
                background-color: rgb(221, 221, 221);
                border-style: solid;
                border-width: 1px;
                padding: 10px 5px;
            }

            .blank {
                border: none;
            }
        </style>
        </head>
        <body>
            <!-- Seu HTML aqui -->

            <!-- HEADER DOCUMENTO -->
            <table>
                <tr>
                    <td>
                    <img src="data:image/svg+xml;base64," style="height: 50px"/>
                    </td>
                    <td style="width: 80%;">
                        <p>
                            <b>Relatrio de Fornecedores</b> - CadMERENDA
                        </p>
                    </td>
                    <td>
                        <p style="margin-top: 5px; margin-bottom: 10px;">${date}</p>
                    </td>
                </tr>
            </table>`;

  for (let i = 0; i < suppliers.length; i += 1) {
    const supplier = suppliers[i];
    const offer = offers[i];
    relatorioHTML += `
            <!-- REPETE A PARTIR DAQUI -->

            <!-- HEADER FORNECEDOR -->
            <hr style="margin-top: 20px; margin-bottom: 20px;">
            <table class="supplier-header">
                <tr>
                    <td style="border-right: 0; width: 8%;">NOME FANTASIA</td>
                    <td style="border-left: 0;">
                        <b>${supplier.trade_name}</b>
                    </td>
                    <td style="border-right: 0; width: 3%;">CNPJ</td>
                    <td style="border-left: 0;">
                        <b>${supplier.cnpj}</b>
                    </td>
                    <td style="border-right: 0; width: 7%;">RESPONSVEL</td>
                    <td style="border-left: 0;">
                        <b>${supplier.tech_manager}</b>
                    </td>
                    <td style="border-right: 0; width: 3%;">TEL</td>
                    <td style="border-left: 0;">
                        <b>${supplier.phone}</b>
                    </td>
                </tr>
                <tr>
                    <td style="border-right: 0;">ENDEREO</td>
                    <td style="border-left: 0;" colspan="5">
                        <b>${supplier.address.street}, ${supplier.address.number} ${supplier.address.complement}, ${supplier.address.city}</b>
                    </td>
                    <td style="border-right: 0;">CERTIDES</td>
                    <td style="border-left: 0;" colspan="2">
                        <b>PENDENTES</b>
                    </td>
                </tr>
            </table>

            <!-- LISTAGEM -->
            <table>
                <thead>
                    <th>ITEM</th>
                    <th>DESCRIO</th>
                    <th style="width: 3%">UN</th>
                    <th style="width: 7%">PERIODICIDADE</th>
                    <th style="width: 5%">QTD MAX</th>
                    <th style="width: 6%">PREO UN</th>
                    <th style="width: 10%">MARCA</th>
                        <th style="width: 10%">PREO TOTAL</th>
                    </thead>
                    <tbody class="items">
                        ${offer.offered_products
                          .map(
                            (product) => `
                            <tr>
                                <td>${product.name}</td>
                                <td>${product.description}</td>
                                <td>${product.measure}</td>
                                <td>SEMANAL</td>
                                <td>${product.quantity}</td>
                                <td>R$ ${product.product_price.toFixed(2)}</td>
                                <td>${product.brand}</td>
                                <td>R$ ${(
                                  product.product_price * product.quantity
                                ).toFixed(2)}</td>
                            </tr>
                        `,
                          )
                          .join('')}
                        <!-- TOTAL -->
                        <tr>
                            <td class="blank"></td>
                            <td class="blank"></td>
                            <td class="blank"></td>
                            <td class="blank"></td>
                            <td class="blank"></td>
                            <td class="blank"></td>
                            <td class="total">TOTAL</td>
                            <td style="border-left: 0;">
                                <b>R$ ${offer.total_price.toFixed(2)}</b>
                            </td>
                        </tr>
                    </tbody>
                </table>
        `;
  }
  relatorioHTML += `</body></html>`;
  return relatorioHTML;
}

module.exports = { createReport };
